jQuery(window).on("load", function () {
  jQuery("#delete_all_alert_specimens").on("click", function (t) {
    t.preventDefault();
    var e = jQuery(this),
        a = e.attr("alert-check"),
        r = e.attr("alert-types");
    confirm(a) && jQuery.post(ajaxurl, {
      action: "remove_alerted_posts",
      filtered_post_types: r
    }, function (t) {
      var e = jQuery(t).find("response_data").text();
      alert(e), location.reload();
    });
  }), jQuery("#dismiss_all_alert_specimens").on("click", function (t) {
    t.preventDefault();
    var e = jQuery(this),
        a = e.attr("data-dismiss-all-check"),
        r = e.attr("alert-types");
    confirm(a) && jQuery.post(ajaxurl, {
      action: "dismiss_alerts_ajax",
      filtered_post_types: r,
      all_alerts: "true"
    }, function (t) {
      var e = jQuery(t).find("response_data").text();
      alert(e), location.reload();
    });
  }), jQuery(".alert-dismisser").on("click", function (t) {
    t.preventDefault();
    var e = jQuery(this),
        a = e.attr("data-alert-dismiss-check"),
        r = e.attr("alert-types"),
        s = e.attr("data-alert-post-id");
    confirm(a) && (e.parent("p").hide(), jQuery.post(ajaxurl, {
      action: "dismiss_alerts_ajax",
      filtered_post_types: r,
      alert: s
    }, function (t) {
      var e = jQuery(t).find("response_data").text();
      alert(e);
    }));
  });
});